import { useState } from "react";
import "./styles.css";

function Form() {
	const [testUrl, setTestUrl] = useState("");
	const [testito, setTestito] = useState("");

	function getData(url){
		console.log("holowoooo");
		setTestito(url + 69);
	}

	return (
		<div>
			<div class="row">
				<div class="input-field col s12">
					<input onChange={(event)=> {setTestUrl(event.target.value)}} id="email" type="text" class="validate" />
					<label for="email">Webpagetest URL</label>
				</div>
			</div>

			<button onClick={ ()  => getData(testUrl) } class="btn waves-effect waves-light" type="submit" name="action">
				Submit
			</button>

	<		span>{testito}</span>
		</div>
	);
}

export default function App() {
	return (
		<div className="App">
			<Form />
		</div>
	);
}
